var facturaUrl=global_settings.urlCORS+"api/facturaapi/";registrationModule.factory("facturaRepository",function(t){return{getEmpty:function(){return t.get(facturaUrl+"0")},getServicioEmpty:function(){return t.get(facturaUrl+"1")},eventual:function(r){return t.post(facturaUrl,r)},"delete":function(r,u,a){return t["delete"](facturaUrl+r+"-"+u+"-"+a)},promocion:function(r,u,a,e,n,c){return t.put(facturaUrl+r+"-"+u+"-"+a+"-"+e+"-"+n+"-"+c)}}});